text:
Meu Deus todo poderoso

Eu me coloco diante da sua presença para te agradecer por tudo que o senhor tem feito na minha vida.

Pai, coloque os seus anjos em prontidão nesta casa e nestes quartos e que junto com eles o senhor possa estar protegendo, guardando e livrando de todo o mal eu e a minha família, Deus venha abitar, venha fazer morada na minha casa e na minha vida, me encha do seu espírito santo, derrame sobre mim a sua unção

Que todo demônio, todo incubu, todo sucubo, todo espírito imundo, maligno e todo ser das trevas venha ser repreendido, espulso e mandado embora de dentro dessa casa pra bem longe pra nunca mais voltar e que toda a praga, toda feitiçaria, toda bruxaria, toda maldição, todo trabalho de satanás/diabo, contra minha vida ou contra a vida da minha família venha ser repreendido, anulado, cancelado e frustrado em nome do senhor Jesus Cristo

Senhor não permita que o inimigo tente me assustar ou colocar medo em mim. 

Coloque um sono pesado e profundo sobre mim e que eu ao deitar minha cabeça e fechar os olhos eu durma bem e descanse bem.

Que essa noite possa ser abençoada, de paz, tranquilidade e descanso, que eu não tenha pesadelos nem sonhos imorais, perversos, negativos e que não lhe agradam, que eu tenha sonhos puros, bondosos, positivos e que lhe agradam, fique ao meu lado Deus cuida de mim enquanto durmo, eu preciso de ti.

Meu pai que estás no céu

Santificado seja o seu santo nome;

Venha nós ao seu reino, seja feita a sua vontade, assim na terra como no céu;

O pão nosso de cada dia nos dê hoje;

Me perdoa pelas minhas dívidas e ofensas, assim como eu tenho perdoado aos meus devedores e aqueles que me tem ofendido;

Me dê forças para que eu não caia na tentação do pecado e livra-me de todo o mal ;

Porque seu é o reino, o poder e a glória, hoje e para sempre, em nome de Jesus é que eu oro e já te agradeço amém

Glórias a ti senhor aleluia, glorificado, honrado, exautado, santificado e louvado seja o seu santo nome meu Deus todo poderoso que eu tanto amo.

Obrigado por tudo Deus eu te amo, como também amo a Cristo Jesus❤

Alimentos que ajudam a PREVENIR e/ou combater DEPRESSÃO:

Antes de consumir estes alimentos consuma com URGÊNCIA, é INEGOCIÁVEL o uso do COMPLEXO B CONCENTRADO, pois há deficiência destas vitaminas que enfraquecem o cérebro.

-BANANA e sua casca (um excelente alimento, (dica: bolo feito com a casca e cacau em pó);
-BANANA VERDE (cozinhar com casca na pressão, separar as porções liquidificadas e usar em carnes, bolos, pastas)
Seu sabor é neutro.
- LIMÃO: use 1 ao dia em sucos durante sua refeição;
- 1 punhado de CASTANHAS e NOZES/dia, quando possível;
- FLOR DE CAMOMILA para chá
(2 colh de sopa, irá liberar na água quente óleos essenciais capazes de relaxar a musculatura, desacelerar a mente e dar sono;
- ABACATE PURO (1 FATIA: Não engorda, controla colesterol e melhora PA e glicemia);
- para dar ânimo por 7 dias (pela manhã):
suco de fruta com: 2 colheres de sopa de aveia + 2 colh de germen de trigo + 2 colh de farinha de maçã + 2 ch de gergelim.
- Azeite de oliva extra virgem: 
1 colher de sopa sobre a refeição.

E o mais importante, Jesus, ele é o Pão, a porta, a água, o Senhor de nossas almas, o
Caminho a Verdade e a Vida.

o ser humano é estranho... 
briga com os vivos, e leva flores para os mortos; lanças vivas na sarjeta, e pede um "bom lugar para os mortos".
se afasta dos vivos, e se agarra de desesperados quando estes morrem;
fica anos sem conversar com vivo, e se desculpa a, fazer homenagens, quando este morre;
tem tempo para visitar o vivo, mas tem o dia todo para ir ao velório do morto;
critica, fala mal, ofende o vivo, mas o santifica quando este morre;
não liga a, não abraça amiga ela não se importa com os vivos, mas se autoflagelam quando estes morrem...
aos olhos cegos do homem, o valor do ser humano está na sua morte, e não na sua vida. 
é bom repensarmos isto, enquanto ainda é tempo.
